        if _is_one_way(a, b):
            return 0
        if _is_connected(a, b):
            return 1
        return 2

    def _sum_cost(a: int, b: int) -> int:
        return _cost(a, b) + _cost(b, a)

    def _min_cost(a: int, b: int) -> int:
        return min(_cost(a, b), _sum_cost(a, b))

    ways = []
    for _ in range(k):
        l = sorted([(i, j) for i, j in l if i!= j], key=lambda x: _sum_cost(x[0], x[1]))
        ways.append(''.join(str(_min_cost(a, b)) for a, b in l))

    return '\n'.join(ways)


