    def is_valid(i, j):
        return i >= 0 and j >= 0 and i < n and j < m and grid[i][j] == '*'
    def get_cell_neighbors(i, j):
        return filter(is_valid, (i-1, j), (i+1, j), (i, j-1), (i, j+1))
    def get_stars(i, j, s):
        return (i, j, s)
    def is_star(i, j, s):
        return i == 0 or i == n - 1 or j == 0 or j == m - 1 or (i == 0 and j == 0) or (i == 0 and j == m - 1) or (i == n - 1 and j == 0) or (i == n - 1 and j == m - 1)
    def draw_stars(i, j, s):
        for x, y, s in [(i-1, j, s), (i+1, j, s), (i, j-1, s), (i, j+1, s)]:
            if is_star(x, y, s):
                grid[x][y] = '*'
    def get_stars_for_draw(i, j, s):
        neighbors = get_cell_neighbors(i, j)
        for x, y, s in neighbors:
            if is_star(x, y, s):
                yield x, y, s
            else:
                yield x, y, 1
    stars = 0
    for i in range(n):
        for j in range(m):
            if grid[i][j] == '*':
                stars += 1
                draw_stars(*get_stars_for_draw(i, j, 1))
    return str(stars) if stars <= n*m else "-1"

