    edges = sorted(edges, key=lambda e: (e[0], e[1]))
    _, x, _ = set(map(lambda e: e[0], edges)), set(map(lambda e: e[1], edges)), set(map(lambda e: e[1], edges))
    if x!= x.union(set(range(1, n + 1))):
        return 0
    mst_cost = sum(map(lambda e: e[2], edges))
    MST = [e for e in edges if e[0] not in x and e[1] not in x]
    for edge in MST:
        mst_cost += edge[2]
    while mst_cost!= 0:
        for i in range(len(edges)):
            if edges[i][0] not in x and edges[i][1] not in x:
                mst_cost -= edges[i][2]
                edges[i][2] += 1
                if mst_cost == 0:
                    break
    return len(MST)


