            return f"Node(index={self.index}, value={self.value})"

    class Shelf:
        def __init__(self) -> None:
            self.left = None
            self.right = None
            self.length = 0

        def __repr__(self):
            return f"Shelf(left={self.left}, right={self.right}, length={self.length})"

    def push(shelf: Shelf, index: int, value: int) -> None:
        node = Node(index, value)
        if shelf.length == 0:
            shelf.left = node
        else:
            if shelf.left.index < shelf.right.index:
                shelf.left.next = node
            else:
                shelf.right.next = node
        shelf.length += 1

    def pop(shelf: Shelf) -> int:
        if shelf.length == 0:
            return -1
        if shelf.left.index < shelf.right.index:
            ret = shelf.left.index
            shelf.left = shelf.left.next
        else:
            ret = shelf.right.index
            shelf.right = shelf.right.next
        shelf.length -= 1
        return ret

    def search(shelf: Shelf, index: int) -> int:
        if shelf.length == 0:
            return -1
        if shelf.left.index <= index <= shelf.right.index:
            return index
        if shelf.left.index < index:
            return shelf.right.index
        if shelf.right.index < index:
            return shelf.left.index

    def move(shelf: Shelf, index: int, shift: int) -> None:
        if shift > 0:
            shift = -shift
        while index < shelf.left.index - shift:
            shelf.push(shelf.left.index - shift, shelf.left.value)
            shelf.left = shelf.left.next
        while index > shelf.right.index + shift:
            shelf.push(shelf.right.index + shift, shelf.right.value)
            shelf.right = shelf.right.next

