def solution(stdin: str) -> str:
    K, N = map(int, stdin.split())
    A = list(map(int, stdin.split()))

    # monotonic stack
    stack = []
    for i, a in enumerate(A):
        while stack and a < A[stack[-1]]:
            j = stack.pop()
            A[j] += a
        stack.append(i)

    # monotonic queue
    queue = []
    for i, a in enumerate(A):
        while queue and A[queue[0]] < a:
            j = queue.pop(0)
            A[j] += a
        queue.append(i)

    return str(max(A))

