def solution(stdin: str) -> str:
    A = list(map(int, stdin.split()))

    def canPartition(A):
        if sum(A) % 3:
            return False
        target = sum(A) // 3
        table = [[False] * (target + 1) for _ in range(len(A) + 1)]
        table[0][0] = True
        for i, x in enumerate(A, 1):
            for j in range(target + 1):
                if j >= x:
                    table[i][j] |= table[i - 1][j - x]
                else:
                    table[i][j] |= table[i - 1][j]
        return table[-1][-1]

    return "true" if canPartition(A) else "false"

