def solution(stdin: str) -> str:
    from queue import Queue
    from copy import deepcopy

    n = int(stdin)
    if n == 0:
        return []

    def f(n: int) -> list[int]:
        if n == 0:
            return [1]
        q = Queue()
        q.put(0)
        p = [0] * (n + 1)
        p[0] = 1
        while not q.empty():
            t = q.get()
            if t == n:
                return deepcopy(p)
            for i in range(1, n + 1):
                p[i] = p[t] + p[t + 1]
                if i + t < n + 1:
                    q.put(i + t)
        return deepcopy(p)

    return " ".join(map(str, f(n)))


