    def find_max_area_rectangle(x: int, y: int) -> int:
        area_min = get_min_area(x, y)
        area_max = get_max_area(x, y)
        return merge(x, y) if area_min * area_max == get_max_area(x, y) * get_min_area(x, y) else 0

