    def ap(c: int, a: int, b: int) -> int:
        """Return the minimum amount of money required to prepare X A-pizzas.

        Args:
            a (int): A-pizza price
            b (int): B-pizza price
            c (int): AB-pizza price

        Returns:
            int: minimum amount of money required to prepare X A-pizzas
        """

        if a > b:
            a, b = b, a
        if a > c:
            a, c = c, a
        if a > 0 and b > 0:
            return (a + b) * 2
        return a + c

    def bp(c: int, a: int, b: int) -> int:
        """Return the minimum amount of money required to prepare Y B-pizzas.

        Args:
            a (int): A-pizza price
            b (int): B-pizza price
            c (int): AB-pizza price

        Returns:
            int: minimum amount of money required to prepare Y B-pizzas
        """

        if a > b:
            a, b = b, a
        if a > c:
            a, c = c, a
        if b > 0 and c > 0:
            return (a + c) * 2
        return a + b

