def solution(stdin: str) -> str:
    '''
    The naive solution is to sort the substrings and iterate through them in descending order.
    We can save a lot of time by using a more efficient algorithm.
    The idea is to use a priority queue.
    Add all the substrings to a priority queue, keeping track of the count of each substring.
    We can quickly remove the substring with the largest count.
    In a second pass, we can simply print the K-th smallest substring.
    '''
    N = int(stdin)
    s = stdin
    if len(s) <= 50:
        substrings = sorted([s[i:j+1] for i in range(len(s)) for j in range(i+1, len(s))])
        if len(substrings) < N:
            return ''.join(substrings[N-1])
        else:
            while len(substrings) > N:
                substrings.pop()
            return ''.join(substrings[N-1])

    substrings = []
    counts = defaultdict(int)
    for i in range(len(s)):
        counts[s[i]] += 1
        substrings.append((s[i], i))
    pq = [(-counts[s[0]], s[0])]
    for i in range(1, len(s)):
        while len(pq) > 0 and counts[s[i]] < pq[0][0]:
            pq.pop(0)
        if len(pq) < N:
            pq.append((-counts[s[i]], s[i]))
            counts[s[i]] += 1
        else:
            pq.append((-counts[s[i]], s[i]))
            pq.pop(0)
    return pq[0][1]

