    lines = stdin.strip().split('\n')
    n = int(lines[0])
    a = list(map(int, lines[1].split()))
    a_shifted = [0] * n
    # put all books on bookshelf to a_shifted
    for i in range(n):
        a_shifted[i] = 1 if a[i] == 1 else 0
    # compute shifts for books
    shifts = 0
    shift_array = [0] * (n + 1)
    for i in range(1, n + 1):
        if a_shifted[i - 1] == 1 and a_shifted[i] == 0:
            shift = 1
            while shift:
                if a_shifted[i - shift] == 1:
                    a_shifted[i - shift] = 0
                    shift_array[i] += shift
                    shifts += 1
                    shift -= 1
                else:
                    shift = 0
    # compute the number of moves needed to fill the bookshelf
    for i in range(n):
        shifts += shift_array[i + 1] - shift_array[i]
    # print(shifts)
    return str(shifts)

