def solution(stdin: str) -> str:
    n, c = [int(i) for i in stdin.strip().split(' ')]
    stairs = [int(i) for i in stdin.strip().split(' ')]
    elevator = [int(i) for i in stdin.strip().split(' ')]

    def get_time(a, b, c):
        total_time = 0
        # stairs
        total_time += a
        # elevator
        total_time += c
        # floors
        for i in range(1, n):
            if i <= a + b:
                total_time += (a + b + 1)
            else:
                total_time += (a + 1)
        return total_time

    result = [0] * n
    for i in range(1, n):
        result[i] = get_time(stairs[i - 1], elevator[i - 1], stairs[i])
    return''.join(str(i) for i in result)

def solution(stdin: str) -> str:
