    stairs = list(map(int, stdin.readline().split()))
    elevator = list(map(int, stdin.readline().split()))

    def find_time(n: int, stairs: List[int], elevator: List[int]) -> int:
        last_time = 0
        for i in range(n):
            last_time = max(last_time, stairs[i]) + elevator[i]
            stairs[i] += elevator[i]
